  private var mDataProvider : ReadOnlyObject_ArtworkRoot? = nil
  private var mTransientKind : PropertyKind = .empty

  //····················································································································

  func setDataProvider (_ inProvider : ReadOnlyObject_ArtworkRoot?) {
    if self.mDataProvider !== inProvider {
